import React, { Component } from 'react'

import './login.css'
import logo from '../../assets/images/logo.png'

export default class App extends Component {


  render() {
    return (
      <div className='login'>
        <header className="login-header">
          <img src={logo} alt="logo" />
          <h1>React项目: 后台管理系统</h1>
        </header>
      </div>
    )
  }
}
